type variant struct {
	i     int
	steps int
}

func squashArray(arr []int) []int {
	c := [3]int{arr[0], arr[1], arr[2]}
	s := []int{}

	for i := 3; i < len(arr); i++ {
		if c[0] == c[1] && c[1] == c[2] && arr[i] == c[2] {
			// ignore
			continue
		}
		// shift
		s = append(s, c[0])

		c[0] = c[1]
		c[1] = c[2]
		c[2] = arr[i]
	}

	s = append(s, c[0], c[1], c[2])

	return s
}

func minJumps(arr []int) int {
	if len(arr) <= 1 {
		return 0
	}

	if len(arr) > 9 {
		arr = squashArray(arr)
	}

	fmt.Printf("squashed: %+v\n", arr)

	maxI := len(arr) - 1
	variants := []variant{{i: 0, steps: 0}}

	visitedIndexes := map[int]struct{}{}
	visitedIndexes[0] = struct{}{}

	for {
		variants, visitedIndexes = step(arr, variants, maxI, visitedIndexes)

		// fmt.Printf("variants: %+v\nvisited: %+v\n", variants, visited)

		for _, v := range variants {
			if v.i == maxI {
				return v.steps
			}
		}
	}
}

func step(arr []int, variants []variant, maxI int, visitedIndexes map[int]struct{}) ([]variant, map[int]struct{}) {
	newVariants := []variant{}

	for _, v := range variants {
		curV := arr[v.i]

		if v.i > 1 {
			if _, found := visitedIndexes[v.i-1]; !found {
				newVariants = append(newVariants, variant{i: v.i - 1, steps: v.steps + 1})
				visitedIndexes[v.i-1] = struct{}{}
			}
		}

		if v.i < (maxI) {
			if _, found := visitedIndexes[v.i+1]; !found {
				newVariants = append(newVariants, variant{i: v.i + 1, steps: v.steps + 1})
				visitedIndexes[v.i+1] = struct{}{}
			}
		}

		for j, a := range arr {
			if a != curV {
				continue
			}

			if _, found := visitedIndexes[j]; !found {
				newVariants = append(newVariants, variant{i: j, steps: v.steps + 1})
				visitedIndexes[j] = struct{}{}
			}
		}
	}

	return newVariants, visitedIndexes
}
